import "bootstrap/dist/css/bootstrap.min.css";
import { createApp } from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import { library } from '@fortawesome/fontawesome-svg-core'

/* import font awesome icon component */
import { FontAwesomeIcon } from '@fortawesome/vue-fontawesome'

/* import specific icons */
import { faMobile, faClock, faHome, faGithub,faTwitter,faFacebook,faInstagram,faLinkedinIn } from '@fortawesome/free-solid-svg-icons'

/* add icons to the library */
library.add(faMobile, faClock, faHome, faGithub,faTwitter,faFacebook,faInstagram,faLinkedinIn)

createApp(App).use(store).use(router).component('font-awesome-icon', FontAwesomeIcon).mount('#app')


import "bootstrap/dist/js/bootstrap.js";
import "bootstrap"
